  return (
    <div className="App">
      <header className="App-header">
        {/* Header */}
        <h1>Weather</h1>
        <input type="text" placeholder="Поиск" />

        {/* Location */}
        <p>Moscow, Russian Federation</p>
        {/* Temperature */}
        <p>32°C</p>
        {/* Condition */}
        <p>Sunny</p>
      </header>
    </div>
  );
}

export default App;
